function generalResponse(obj, dateToParse) {
  //dateToParse = ["CreationDate"]
  if (!obj) return;

  const result = {};

    for (let [k, v] of Object.entries(obj)) {
      if (dateToParse.includes(k)) {
        result[k] = iml.formatDate(v, "YYYY-MM-DD hh:mm A");
      } else if (Array.isArray(v)) {
        result[k] = obj[k].map((i) => {
          return iml.generalResponse(i, dateToParse);
        });
      } else if (v && v.constructor === Object && !(v instanceof Date)) {
        result[k] = iml.generalResponse(v, dateToParse);
      } else {
        result[k] = v;
      }
    }
    /* obj.Birthday = iml.parseDate(obj.Birthday, 'X');
          obj.CreationDate = iml.parseDate(obj.CreationDate, 'X'); */

    return result;

}

